import React, { Fragment } from "react";
import { connect } from "react-redux";
import { Redirect } from "react-router-dom";

const EmployeeDashBoard = ({ employee: { employee } }) => {
  if (!employee) {
    return <Redirect to="/employee-login" />;
  }

  console.log(typeof customers);
  return (
    <Fragment>
      <h3>Your Clients</h3>
      {employee.customers
        ? employee.customers.map((customer) => {
            return (
              <div className="card" key={customer.identifier}>
                <div className="card-body">
                  <h4>
                    {customer.firstName} {customer.lastName}
                  </h4>
                </div>
              </div>
            );
          })
        : null}
    </Fragment>
  );
};

const mapStateToProps = (state) => ({
  employee: state.employee,
});

export default connect(mapStateToProps)(EmployeeDashBoard);
